INSERT INTO `pelicula` VALUES (3,'EL JUEGO DEL MIEDO','Adam y Lawrence se despiertan encadenados en un sucio baño con un cadáver entre ellos. Su secuestrador es un loco conocido como Jigsaw cuyo juego consiste en forzar a sus cautivos a herirse a si mismos o a otros con tal de permanecer vivos','Pepito',92,'https://live.staticflickr.com/65535/51558623296_51e3dfdb58_m.jpg','2021-05-05',5,4),(4,'EL CONJURO','Narra los encuentros sobrenaturales que vivia la familia Perron en su casa de Rhode Island a principios de los 70. Ed y Lorraine Warren, investigadores de renombre en el mundo de los fenomenos paranormales, acuden a la llamada de una familia aterrorizada por la presencia en su granja de un ser maligno.','Juan',90,'https://live.staticflickr.com/65535/51558856383_43594a7227_m.jpg','2021-10-02',3,4),(5,'LA NARANJA MECANICA','Alex es un joven muy agresivo que tiene dos pasiones: la violencia desaforada y Beethoven. Es el jefe de la banda de los drugos, que dan rienda suelta a sus instintos más salvajes aterrorizando a la población.','Stanley Kubrick',136,'https://wmagazin.com/wp-content/uploads/2021/08/Cine-Club-literario-Lanaranjamecanica-cartel-1-e1628878059463.jpg','1971-12-19',3,1),(6,'LA ISLA SINIESTRA','Verano de 1954. Los agentes judiciales Teddy Daniels y Chuck Aule son enviados a una remota isla del puerto de Boston para investigar la desaparición de una peligrosa asesina recluida en el hospital ','Martin Scorsese',138,'https://4.bp.blogspot.com/-Y7LZMCKJp8g/WjhE5pTRkhI/AAAAAAAAJZo/vOEF6pfUx7IDU49cmCd5j9bwRh1BrlTsgCLcBGAs/s1600/MV5BY2NkNTcxNjAtODhjMS00Mjg2LWI1OGItMjRhMGJlODBkZTVlL2ltYWdlL2ltYWdlXkEyXkFqcGdeQXVyNzAxMjE1NDg%2540._V1_SY1000_CR0%252C0%252C675%252C1000_AL_.jpg','2010-02-18',3,5),(7,'COMO SI FUERA LA PRIMERA VEZ','Henry, biólogo marino, no tiene la mínima intención de comprometerse con nadie, hasta que conoce a Lucy, la chica de sus sueños. Sin embargo, hay un pequeño problema, la joven se levanta cada mañana sin recordar absolutamente nada del día anterior.','Peter Segal',99,'https://mx.web.img3.acsta.net/pictures/18/10/05/00/01/1103522.jpg','2004-01-13',4,2),(8,'BUSQUEDA IMPLACABLE','El exagente de las fuerzas especiales de élite Bryan Millis se ve enredado en la trama de una organización criminal cuando trata de salvar a su hija, Kim. En un viaje a Paris, Kim y una amiga son raptadas por una red criminal que trafica con mujeres, especialmente chicas jóvenes.','Pierre Morel',93,'https://mx.web.img3.acsta.net/pictures/20/09/25/00/12/3064092.jpg','2008-09-18',4,3),(9,'LA MONJA','Una monja se suicida en una abadía rumana y el Vaticano envía a un sacerdote y una novicia a investigar lo sucedido. Lo que ambos encuentran allí es un secreto perverso que los enfrentará cara a cara con el mal en su esencia más pura.','Corin Hardy',96,'https://es.web.img2.acsta.net/pictures/18/08/14/15/35/4396669.jpg','2018-09-07',4,4),(10,'ACTIVIDAD PARANORMAL 2','Después de sufrir lo que ellos creen una serie de robos, una familia coloca cámaras de seguridad en toda la casa, descubriendo para su sorpresa un lado mucho más siniestro que los propios sucesos inquietantes que están viviendo.','Tod Williams',91,'https://images-na.ssl-images-amazon.com/images/S/pv-target-images/7673270068f2d30557cd97936f77d590f746e3b49afdb1a9b3821ddf6f095bcc._RI_V_TTW_.jpg','2010-10-22',3,5),(11,'INACTIVIDAD PARANORMAL','Después de haber exorcizado los demonios de su ex, Malcolm empieza una nueva vida junto a su novia y los dos hijos de esta. Sin embargo, tras mudarse a la casa de sus sueños, vuelve a sufrir extraños sucesos paranormales.','Michael Tiddes',86,'https://i.blogs.es/4900bb/a_haunted_house_2/450_1000.jpg','2014-04-18',5,6),(22,'SPIDER-MAN: NO WAY HOME','Tras descubrirse la identidad secreta de Peter Parker como Spider-Man, la vida del joven se vuelve una locura. Peter decide pedirle ayuda al Doctor Extraño para recuperar su vida. Pero algo sale mal y provoca una fractura en el multiverso.','Jon Watts',90,'https://www.ecartelera.com/carteles/15800/15882/005_m.jpg','2022-02-23',2,3),(25,'LIGHTYEAR','Buzz Lightyear se embarca en una aventura intergaláctica con un grupo de reclutas ambiciosos y su compañero robot.','Angus MacLane',105,'https://lumiere-a.akamaihd.net/v1/images/p_disney_lightyear_519_c4636841.jpeg','2022-06-16',5,20),(26,'CARS','El aspirante a campeón de carreras Rayo McQueen parece que está a punto de conseguir el éxito. Su actitud arrogante se desvanece cuando llega a una pequeña comunidad olvidada que le enseña las cosas importantes de la vida que había olvidado.','John Lasseter',90,'https://es.web.img2.acsta.net/medias/nmedia/18/82/02/41/19753255.jpg','2006-06-29',5,20),(32,'QUE PASO AYER','Dos días antes de su boda, Doug y tres amigos viajan a Las Vegas para una fiesta inolvidable y salvaje. De hecho, cuando los tres acompañantes despiertan la mañana siguiente, no recuerdan nada ni encuentran a Doug. Con poco tiempo por delante, los tres amigos intentan recordar sus pasos y encontrar a Doug para que regrese a Los Ángeles para su boda.','Todd Phillips',150,'https://pics.filmaffinity.com/A_Qu_pas_ayer-567756276-large.jpg','2009-08-10',3,6),(33,'EL MISTERIO DE LA LIBELULA','Un doctor se siente culpable y afligido, pues cree que su esposa intenta contactarlo desde el más allá del sepulcro.','Tom Shadyac',120,'https://mx.web.img2.acsta.net/pictures/20/09/25/19/50/2252923.jpg','2023-04-26',4,1);
